  false,\n\t\"url\": null,\n\t\"notes\": \"This resource is available as a downloadable
  file, ESRI Service, and as a Web Feature service.  Resource includes six plates
  with downloadable images:  Plate I: Surficial Material, Plate II: Bedrock, Plate
  III: Ground Water Potential, Plate IV: Solid Waste Disposal Conditions, Plate VI:
  General Construction Conditions, and Plate VII: Sand and Gravel Reserves. Resource
  also includes text on Environmental planning for the Milton-St. Albans Region, Vermont.
  \ For more information see links provided. nnThis report is the fifth in a series
  concerned with environmental problems published by the Vermont Geological Survey.
  The purpose of these reports is to supply geological information in a condensed
  and modified form for use by environmental planners. The reports attempt to describe
  and explain the geologic conditions of a specific region, and to outline and summarize
  these conditions on a series of large-scale maps in such a way as to make the material
  useful for planners. Most planning agencies do not have geologists on their staffs,
  and these reports supply the geologic background necessary for adequate planning.\",\n\t\"license_title\":
